import { ReactComponent as CheckSVG } from './check.svg';
import { ReactComponent as DeleteSVG} from './delete.svg';

const iconTypes = {
    'check': <CheckSVG className='' />,
    'delete': <DeleteSVG />
};

const functionTypes = {
    'check': 'onComplete',
    'delete': 'onDelete'
}

function TodoIcon({ type, oncomplete, ondelete, text }) {
    return (
        <span
            className={`Icon-container Icon-container-${type}`}
            onClick={() => {`on${type}`(text)}}
        >
            {iconTypes[type]}
        </span>
    );
}

export { TodoIcon };
